const Login = () => {
    return(
        <div>
          <div className="container">
            <div className="row">
                <div className="col-md-5">
                    <h1 className="display-4">Welcome Back</h1>
                    <p className="lead">Enter Your Credentials To Login</p>
                    <h5>OR</h5>
                    <NavLink to="/register" className="btn"></NavLink>
                </div>
            </div>
          </div>
        </div>
        );
    }
    
    export default Login;
